import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <div className="container">
        <div className="row p-2">
          <div className="col-3 sticky-column">
            <h1 className='text-primary'><i class="bi bi-twitter"></i></h1>
          </div>
          <div className="col-6  d-flex align-items-center border border-top-0">
            <div className="content-wrapper">
              <h5>Home</h5>
              <h3 className='ms-auto text-primary'><i class="bi bi-stars"></i></h3>
            </div>
          </div>
          <div className="col-3 d-flex align-items-center sticky-column">
            <input type="text" placeholder='Search Twitter'
            className='w-100 rounded-4 border border-0 bg-secondary-subtle px-3 py-1'/>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
